import './App.css';
import Header from './Header';

//import { useState } from "react";
import default_lat from './config/config.js';
import default_lon from './config/config.js';
//import CONFIG from './config/config.js';

function App() {

  //const [default_lat,setLat] = useState("");

  return (
    <div className="App">
      <Header />
      <h2 id='titulo'>El tiempo</h2>
      <p>
        <input id='latitud' value={default_lat.default_lat} placeholder="Latitud" />
      </p>
      <p>
        <input id='longitud' value={default_lon.default_lon} placeholder="Longitud" />
      </p>
      <p>
        <button id='buscar'>Buscar</button>
      </p>

      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </div>
  );
}

export default App;
